# ---------- T√åM KI·∫æM WEB ----------
def search_web(query, num_results=3):
    try:
        with DDGS() as ddgs:
            results = ddgs.text(query)
            top = list(results)[:num_results]
            markdown_table = """| Ti√™u ƒë·ªÅ | Li√™n k·∫øt |
|--------|---------|
"""
            for r in top:
                markdown_table += f"| [{r['title']}]({r['href']}) | {r['href']} |\n"
            return markdown_table.strip()
    except:
        return "(L·ªói khi t√¨m ki·∫øm web)"
# ---------- TH·ªúI TI·∫æT / TIN T·ª®C ----------
def fetch_weather():
    try:
        res = requests.get("https://wttr.in/?format=3")
        return res.text
    except:
        return "Kh√¥ng th·ªÉ l·∫•y th√¥ng tin th·ªùi ti·∫øt."
def fetch_news():
    try:
        res = requests.get("https://api.duckduckgo.com/?q=tin+t·ª©c+m·ªõi+nh·∫•t&format=json")
        return res.json().get("AbstractText", "Kh√¥ng c√≥ tin t·ª©c ph√π h·ª£p.")
    except:
        return "Kh√¥ng th·ªÉ l·∫•y tin t·ª©c."
# ---------- KI·ªÇM TRA DANH T√çNH ----------
def is_about_identity(text):
    patterns = ["b·∫°n l√† ai", "t√™n b·∫°n", "ai t·∫°o ra", "ng∆∞·ªùi t·∫°o", "b·∫°n l√† g√¨"]
    return any(p in text.lower() for p in patterns)
# ---------- G·ªåI API ----------
def call_ai_api(api_name, prompt_data, headers):
    url = GROQ_API_URL if api_name == "groq" else OPENAI_API_URL
    try:
        response = requests.post(url, headers=headers, json=prompt_data)
        response.raise_for_status()  # Ki·ªÉm tra l·ªói HTTP
        result = response.json()
        if "choices" in result and result["choices"]:
            return result["choices"][0]["message"]["content"]
        return f"L·ªói ph·∫£n h·ªìi t·ª´ {api_name}: Kh√¥ng t√¨m th·∫•y d·ªØ li·ªáu h·ª£p l·ªá."
    except Exception as e:
        return f"L·ªói khi g·ªçi API {api_name}: {str(e)}"
# ---------- PH√ÇN T√çCH ----------
def analyze_query(user_input, lang_code, memory_context):
    if is_about_identity(user_input):
        return "T√¥i l√† ChatPHAi, tr·ª£ l√Ω AI h·ªó tr·ª£ b·∫°n."
    if "th·ªùi ti·∫øt" in user_input.lower():
        return fetch_weather()
    if "tin t·ª©c" in user_input.lower():
        return fetch_news()
    web_results = search_web(user_input)
    full_prompt = f"""Ng√¥n ng·ªØ ng∆∞·ªùi d√πng: {lang_code.upper()}
C√¢u h·ªèi: {user_input}
K·∫øt qu·∫£ web:
{web_results}
Tr·∫£ l·ªùi ng·∫Øn g·ªçn, r√µ r√†ng, ch√≠nh x√°c v√† ƒë√∫ng ng√¥n ng·ªØ."""
    prompt_data = {
        "model": "llama3-8b-8192",
        "messages": memory_context + [{"role": "user", "content": full_prompt}],
        "temperature": 0.5,
        "max_tokens": 1024,
        "top_p": 0.9,
        "stream": False
    }
    try:
        headers = {"Authorization": f"Bearer {GROQ_API_KEY}", "Content-Type": "application/json"}
        return call_ai_api("groq", prompt_data, headers)
    except:
        try:
            headers = {"Authorization": f"Bearer {OPENAI_API_KEY}", "Content-Type": "application/json"}
            return call_ai_api("openai", prompt_data, headers)
        except Exception as e:
            return f"‚ùå L·ªói h·ªá th·ªëng: {str(e)}"
# ---------- RAG ----------
def query_custom_website(user_input):
    index_path = "./index_storage"
    try:
        if not os.path.exists("website_data"):
            return "Kh√¥ng t√¨m th·∫•y d·ªØ li·ªáu website."
        if os.path.exists(index_path):
            storage_context = StorageContext.from_defaults(persist_dir=index_path)
            index = load_index_from_storage(storage_context)
            # Ki·ªÉm tra n·∫øu d·ªØ li·ªáu website_data thay ƒë·ªïi
            if os.path.getmtime("website_data") > os.path.getmtime(index_path):
                documents = SimpleDirectoryReader("website_data").load_data()
                index = VectorStoreIndex.from_documents(documents)
                index.storage_context.persist(index_path)
        else:
            documents = SimpleDirectoryReader("website_data").load_data()
            index = VectorStoreIndex.from_documents(documents)
            index.storage_context.persist(index_path)
        query_engine = index.as_query_engine()
        return query_engine.query(user_input).response
    except Exception as e:
        return f"L·ªói RAG: {str(e)}"

# ---------- X√ìA CACHE RAG ----------
def clear_rag_cache():
    index_path = "./index_storage"
    if os.path.exists(index_path):
        shutil.rmtree(index_path)
        return "ƒê√£ x√≥a cache RAG th√†nh c√¥ng."
    return "Kh√¥ng t√¨m th·∫•y cache RAG ƒë·ªÉ x√≥a."

# ---------- PH·∫¢N H·ªíI ----------
def chatbot_respond(user_input, language, chat_history, image):
    lang_code = language.lower()
    memory_context = [{"role": "system", "content": f"Tr·ª£ l√Ω AI tr·∫£ l·ªùi b·∫±ng ti·∫øng {lang_code}."}]
    if len(chat_history) >= 2:
        memory_context += [
            {"role": "user", "content": chat_history[-2]['text']},
            {"role": "assistant", "content": chat_history[-1]['text']}
        ]
    if image:
        try:
            img = Image.open(image)
            extracted_text = pytesseract.image_to_string(img, lang='eng+vie')
            user_input += f"\n[H√¨nh ·∫£nh ch·ª©a n·ªôi dung:]\n{extracted_text.strip()}"
        except Exception as e:
            user_input += f"\n[L·ªói x·ª≠ l√Ω ·∫£nh: {str(e)}]"
    answer = analyze_query(user_input, lang_code, memory_context)
    if any(err in answer.lower() for err in ["kh√¥ng t√¨m th·∫•y", "kh√¥ng c√≥ th√¥ng tin"]):
        rag_answer = query_custom_website(user_input)
        if rag_answer:
            answer += f"\n\nüìö D·ªØ li·ªáu n·ªôi b·ªô: {rag_answer}"
    current_time = time.time()
    chat_history.append({'role': 'user', 'text': f"üë§ {user_input}", 'timestamp': current_time})
    chat_history.append({'role': 'assistant', 'text': f"ü§ñ {answer}", 'timestamp': current_time})
    one_day_ago = current_time - 86400
    chat_history = [msg for msg in chat_history if msg['timestamp'] >= one_day_ago]
    history_text = "\n".join([msg['text'] for msg in chat_history])
    return answer, history_text, "", chat_history

# ---------- X√ìA L·ªäCH S·ª¨ H·ªòI THO·∫†I ----------
